pragma solidity ^0.6.6;

import './Flashloan.sol';

contract Factory {
  mapping(address => address) public flashloans;  //map owner to flashloan addresses
  address public addressProvider;
  address public kyberAddress;
  address public uniswapAddress;
  address public wethAddress;
  address public daiAddress;
  IERC20 public projectToken;
  address public adminAddress;


  constructor(
    address _addressProvider,
    address _kyberAddress,
    address _uniswapAddress,
    address _projectTokenAddress
  ) public {
    addressProvider = _addressProvider;
    kyberAddress = _kyberAddress;
    uniswapAddress = _uniswapAddress;
    projectToken = IERC20(_projectTokenAddress);
  }

  function createFlashloan() external {

  require(projectToken.balanceOf(msg.sender) >= 50 * 10 ** 18, 'insufficient balance');
    Flashloan flashloan = new Flashloan(
      addressProvider,
      kyberAddress,
      uniswapAddress,
      address(projectToken),
      msg.sender
    );

    flashloans[msg.sender] = address(flashloan);
  }

}
